using namespace std;


long long countSubarrays(const vector<int>& nums, const int minK, const int maxK) {
    long rs = 0;
    int pref = 0;
    int minSum = 0;
    int maxSum = 0;

    for (const auto val : nums) {
        if (val >= minK && val <= maxK) {
            pref++;
        } else {
            pref = 0;
            minSum = 0;
            maxSum = 0;
        }

        if (val == minK) {
            minSum = pref;
        }
        if (val == maxK) {
            maxSum = pref;
        }

        rs += min(minSum, maxSum);
    }

    return rs;
}



